import React from "react";
import './nav.css';
import Link from './links/links.css'



function Navigation() {
     return(
        <div className="nav">       
        <div className="navRow">   
            <Link href="#" className="navLink">Электроника<span className="navLinkTrait">-</span></Link>
            <a href="#" className="navLink">Смартфоны и гаджеты<span className="navLinkRrait">-</span></a>
            <a href="#" className="navLink">Мобильные телефоны<span className="navLinkRrait">-</span></a>
            <a href="#" className="navLink">Apple</a>
        </div>
    </div> 
     )
}
export default Navigation
